import React, { Component } from 'react'
import './Header.css'
class Header extends Component {
    render() {
        return (
            <div>
              <div className="topnav">
                <a  className="active" href="#home">Home</a>
                <a href="#news">News</a>
                <a href="#contact">Contact</a>
                <a href="#about">About</a>
                </div>
            </div>    
        )
    }
}

export default Header;
